import styles from "./Card.module.css";

function Card(props) {
    const { card } = props;

    return(
        <div className={styles.card}>
            <h1 className={styles.status}>{card.status}</h1>
            <p className={styles[card.status]}>{card.total}</p>
        </div>
    );
}

export default Card;
